import React from 'react';
import '../styles/RightPanel.css';

export default function RightPanel({ patient }) {
  return (
    <aside className="right-panel">
      <div className="patient-info">
        <img
          src={patient.profilePicture || 'https://via.placeholder.com/120'}
          alt={patient.name}
          className="patient-avatar"
        />
        <h3>{patient.name}</h3>
        <p>Age: {patient.age}</p>
        <p>Gender: {patient.gender}</p>
        <p>Insurance: {patient.insuranceType}</p>
        {/* Additional details */}
      </div>

      <div className="lab-results">
        <h2>Lab Results</h2>
        {patient.labResults?.map((result, idx) => (
          <div key={idx}>
            <strong>{result.testName}</strong>: {result.result}
          </div>
        ))}
      </div>
    </aside>
  );
}
